  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arrowwood NWR
  outlines Refuge accomplishments from September through December of 1955. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and vegetation
  control. Resource management is outlined; topics include grazing, haying, and fur
  harvesting. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, hunting, and violations. Items of interest,
  N-R forms, photographs, and newspaper articles are attached.\",\n\t\"license_title\":
